import React from "react";
import { Link } from "react-router-dom";

function CheckoutSteps({ step1, step2, step3, step4 }) {
  return (
    <div>
      <ul class="nav justify-content-center">
        {step1 ? (
          <li class="nav-item">
            <Link class="nav-link active" aria-current="page" to="/login">
              Active
            </Link>
          </li>
        ) : (
          <li class="nav-item">
            <Link class="nav-link disabled" aria-current="page" to="/login">
              Active
            </Link>
          </li>
        )}
        {step2 ? (
          <li class="nav-item">
            <Link class="nav-link active" aria-current="page" to="/payment">
              Active
            </Link>
          </li>
        ) : (
          <li class="nav-item">
            <Link class="nav-link disabled" aria-current="page" to="/payment">
              Active
            </Link>
          </li>
        )}

        {step2 ? (
          <li class="nav-item">
            <Link class="nav-link active" aria-current="page" to="/placeorder">
              Active
            </Link>
          </li>
        ) : (
          <li class="nav-item">
            <Link
              class="nav-link disabled"
              aria-current="page"
              to="/placeorder"
            >
              Active
            </Link>
          </li>
        )}
      </ul>
    </div>
  );
}

export default CheckoutSteps;
